import {FormControlLabel, Radio, RadioGroup} from "@material-ui/core";
import React, {useState} from "react";
import '../styles/components.css';
import {RadioType} from "../objects/enums/RadioType";
import {getTextsByType, getTitleByType} from "../helpers/uiHelper";


export interface RadioConfigGroupProps {
    radioType: RadioType,
    value: number,
    setValue: (arg: any) => void,
}

const RadioConfigGroup = ({radioType, value, setValue}: RadioConfigGroupProps) => {
    const [texts] = useState<string[]>(getTextsByType(radioType));

    return (
        <div>
            <text className='radio-title'>{getTitleByType(radioType)}</text>
            <RadioGroup value={value} on={(object)=>console.log}>
                <FormControlLabel value={0} control={<Radio/>} label={texts[0]}/>
                <FormControlLabel value={1} control={<Radio/>} label={texts[1]}/>
                <FormControlLabel value={2} control={<Radio/>} label={texts[2]}/>
                <FormControlLabel value={3} control={<Radio/>} label={texts[3]}/>
            </RadioGroup>
        </div>
    );
}

export default RadioConfigGroup;
